import React from "react";
import CardInput from "../components/CardInput";

interface User {
  name: string;
  username: string;
  email: string;
  password: string;
}

const Register: React.FC = () => {

  const onRegister = (user: User) => {
    return fetch("https://pandela-youtube.onrender.com/api/profiles/setup/%3Cstr:pk%3E/", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(user),
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        console.log("DATA:", data);
      })
      .catch((error) => {
        console.error('There was a problem with the fetch operation:', error);
      });
  };


  return (
    <div>
      <CardInput
        inputsData={[
          { title: "Ваше имя", type: "text", name: "name" },
          { title: "Придумайте никнейм", type: "text", name: "username" },
          { title: "Почта", type: "email", name: "email" },
          { title: "Пароль", type: "password", name: "password" },
        ]}
        formTitle="Регистрация"
        buttonText="Зарегистрироваться"
        to="/login"
        linkText="Уже зарегистрированы? Войти"
        function={onRegister}
      />
    </div>
  );
};

export default Register;
